import React from 'react';

import { useState } from 'react';
import { useEffect } from 'react';
import { useParams } from 'react-router-dom';
import VolunteerInfo from './VolunteerInfo';


const Volunteer = () => {

    const [dataInfo, setDataInfo] = useState([])
    const { email } = useParams()


    useEffect(() => {
        fetch('http://localhost:4000/items')
            .then(res => res.json())
            .then(data => setDataInfo(data))
    }, [])


    const [image, setImage] = useState([])
    useEffect(() => {
        const matched = dataInfo.filter(pd => pd.email === email && email.toLowerCase())
        setImage(matched)

    }, [email])


    return (
        <div>
            {/* {
                image.map(img => <VolunteerInfo image={img} key={img.id}></VolunteerInfo>)
            } */}

            {
                image.map(img => <li>name: {img.category} date: {img.enterDate}</li>)
            }
        </div>

    );
};

export default Volunteer;
